import React from "react";

function About() {
  return (
    <form>
      <div>
        <textarea input="text" placeholder="Enter the category name " />
        <textarea
          input="text"
          placeholder="Enter teh categort description"
          className="textarea2"
        />
      </div>
    </form>
  );
}

export default About;
